import { Map } from "leaflet";
import React from "react";
import { MapContainer, TileLayer } from "react-leaflet";

const Header = () => {
  return (
    <nav className="flight-Header">
      <ul>
        <li>Flight Watch</li>
        <li>
          <input type="text" name="" id="" />
        </li>
      </ul>
    </nav>
  );
};

export default Header;
